import React from 'react';
import { useNavigate } from "react-router-dom";
import "./styles.css"

function Home() {

    const navigate = useNavigate();

    const navToApplication = () => {
        navigate("/apply");
    }

    const navToGrading = () => {
        navigate("/grading");
    }

    return (
        <div>
            <h1>This is the Application Pipeline Demo.</h1>
            <div className="home">
                <button className='first' onClick={navToApplication}>Application Form</button>
                <button className='second' onClick={navToGrading}>Grading Interface</button>
            </div>
        </div>
    );
};

export default Home;
